import Layout from '../components/Layout'

const Index = () => {
    return (
        <div>
            <div className="image">
            </div>
            <p>Bei langeweile kannst du gerne die Webseite meiner wundervollen Frau besuchen: <a target="_blank" href="https://www.kwerbeed.de">www.kwerbeed.de</a></p>
            <style jsx>{`
                div {
                    display: flex;
                    flex: 1 1 auto;
                    align-tems: center;
                    justify-content: center;
                }
                .image {
                    border-radius: 100%;
                    border: 1px solid;
                    height: 100px;
                    width: 100px;
                }
            `}</style>
        </div>
    )
}

export default Layout(Index)
